import{_ as l,W as s,X as d,a0 as e,a1 as i,$ as n,Y as r,C as t}from"./framework-713583e3.js";const c="/java-tips/assets/1707098183938-49eb947d.png",o="/java-tips/assets/1707098198845-a6524a3d.png",v={},u={href:"https://www.liaoxuefeng.com/wiki/1022910821149312",target:"_blank",rel:"noopener noreferrer"},p=r(`<h2 id="_1-背景" tabindex="-1"><a class="header-anchor" href="#_1-背景" aria-hidden="true">#</a> 1. 背景</h2><p>因为网景开发了JavaScript，一年后微软又模仿JavaScript开发了JScript，为了让JavaScript成为全球标准，几个公司联合ECMA（European Computer Manufacturers Association）组织定制了JavaScript语言的标准，被称为ECMAScript标准。</p><p>不过大多数时候，我们还是用JavaScript这个词。如果你遇到ECMAScript这个词，简单把它替换为JavaScript就行了。</p><p>由于JavaScript的标准——ECMAScript在不断发展，最新版ECMAScript 6标准（简称ES6）已经在2015年6月正式发布了，所以，讲到JavaScript的版本，实际上就是说它实现了ECMAScript标准的哪个版本。由于浏览器在发布时就确定了JavaScript的版本，加上很多用户还在使用IE6这种古老的浏览器，这就导致你在写JavaScript的时候，要照顾一下老用户，不能一上来就用最新的ES6标准写，否则，老用户的浏览器是无法运行新版本的JavaScript代码的。</p><h2 id="_2-快速入门" tabindex="-1"><a class="header-anchor" href="#_2-快速入门" aria-hidden="true">#</a> 2. 快速入门</h2><p>不管哪种方式都需要以 HTML 文件为支撑，并且都需要<strong>写入到 HTML 中 head 标签下的 script 标签</strong>中。script 标签有两种形式：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>&lt;script&gt;
// 这里直接写 js
&lt;/script&gt;

&lt;script src=&quot;/static/js/abc.js&quot;&gt;&lt;/script&gt;

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h3 id="_2-1-基本语法" tabindex="-1"><a class="header-anchor" href="#_2-1-基本语法" aria-hidden="true">#</a> 2.1. 基本语法</h3><ol><li>分号可加可不加，但建议都加；</li><li>严格区分大小写；</li></ol><h3 id="_2-2-数据类型" tabindex="-1"><a class="header-anchor" href="#_2-2-数据类型" aria-hidden="true">#</a> 2.2. 数据类型</h3><h4 id="_2-2-1-number" tabindex="-1"><a class="header-anchor" href="#_2-2-1-number" aria-hidden="true">#</a> 2.2.1. Number</h4><p>不区分整数和浮点数，统一用Number表示 整数最大范围不是±263，而是±253 可以直接做四则运算，规则和数学一致 用十六进制表示整数比较方便</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>1.2345e3; // 科学计数法表示1.2345x1000，等同于1234.5
NaN; // NaN表示Not a Number，当无法计算结果时用NaN表示
Infinity; // Infinity表示无限大，当数值超过了JavaScript的Number所能表示的最大值时，就表示为Infinity

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h4 id="_2-2-2-字符串" tabindex="-1"><a class="header-anchor" href="#_2-2-2-字符串" aria-hidden="true">#</a> 2.2.2. 字符串</h4><p>以单引号&#39;或双引号&quot;括起来的任意文本 转义字符\\可以转义很多字符 用\\u####表示一个Unicode字符，</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>&#39;\\u4e2d\\u6587&#39;; // 完全等同于 &#39;中文&#39;

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p>多行字符串的表示方法，用反引号<code>...</code>表示 ES6新增了一种模板字符串，表示方法和上面的多行字符串一样，但是它会自动替换字符串中的变量：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>let name = &#39;小明&#39;;
let age = 20;
let message = \`你好, \${name}, 你今年\${age}岁了!\`;
alert(message);

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>toUpperCase()把一个字符串全部变为大写 toLowerCase()把一个字符串全部变为小写 indexOf()会搜索指定字符串出现的位置 substring()返回指定索引区间的子串</p><h4 id="_2-2-3-布尔值" tabindex="-1"><a class="header-anchor" href="#_2-2-3-布尔值" aria-hidden="true">#</a> 2.2.3. 布尔值</h4><p>布尔值和布尔代数的表示完全一致，一个布尔值只有true、false两种值，要么是true，要么是false，可以直接用true、false表示布尔值，也可以通过布尔运算计算出来 说明条件判断的顺序非常重要 把null、undefined、0、NaN和空字符串&#39;&#39;视为false，其他值一概视为true &amp;&amp;运算是与运算 ||运算是或运算 !运算是非运算</p><h4 id="_2-2-4-比较运算符" tabindex="-1"><a class="header-anchor" href="#_2-2-4-比较运算符" aria-hidden="true">#</a> 2.2.4. 比较运算符</h4><p>第一种是<mark>比较，它会自动转换数据类型再比较，很多时候，会得到非常诡异的结果； 第二种是</mark>=比较，它不会自动转换数据类型，如果数据类型不一致，返回false，如果一致，再比较。 由于JavaScript这个设计缺陷，_不要_使用<mark>比较，始终坚持使用</mark>=比较。</p><p>另一个例外是NaN这个特殊的Number与所有其他值都不相等，包括它自己：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>NaN === NaN; // false

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p>唯一能判断NaN的方法是通过isNaN()函数：</p><p>最后要注意浮点数的相等比较；浮点数在运算过程中会产生误差，因为计算机无法精确表示无限循环小数。要比较两个浮点数是否相等，只能计算它们之差的绝对值，看是否小于某个阈值：</p><h4 id="_2-2-5-bigint" tabindex="-1"><a class="header-anchor" href="#_2-2-5-bigint" aria-hidden="true">#</a> 2.2.5. Bigint</h4><p>精确表示比253还大的整数，可以使用内置的BigInt类型，它的表示方法是在整数后加一个n，例如9223372036854775808n，也可以使用BigInt()把Number和字符串转换成BigInt： 使用BigInt可以正常进行加减乘除等运算，结果仍然是一个BigInt，但不能把一个BigInt和一个Number放在一起运算：</p><h4 id="_2-2-6-null-和-undefined" tabindex="-1"><a class="header-anchor" href="#_2-2-6-null-和-undefined" aria-hidden="true">#</a> 2.2.6. null 和 undefined</h4><p>null表示一个“空”的值；还有一个和null类似的undefined，它表示“未定义”。 区分两者的意义不大。大多数情况下，我们都应该用null。undefined仅仅在判断函数参数是否传递的情况下有用。</p><h4 id="_2-2-7-数组" tabindex="-1"><a class="header-anchor" href="#_2-2-7-数组" aria-hidden="true">#</a> 2.2.7. 数组</h4><p>数组可以包括任意数据类型，创建数组的两种方法：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>[1, 2, 3.14, &#39;Hello&#39;, null, true];
new Array(1, 2, 3); // 创建了数组[1, 2, 3]

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>出于代码的可读性考虑，强烈建议直接使用[]。索引的起始值为0 要取得Array的长度，直接访问length属性 可以通过indexOf()来搜索一个指定的元素的位置 slice()就是对应String的substring()版本，它截取Array的部分元素，然后返回一个新的Array 注意到slice()的起止参数包括开始索引，不包括结束索引。如果不给slice()传递任何参数，它就会从头到尾截取所有元素。利用这一点，我们可以很容易地复制一个Array</p><p>push()向Array的末尾添加若干元素，pop()则把Array的最后一个元素删除掉</p><p>如果要往Array的头部添加若干元素，使用unshift()方法，shift()方法则把Array的第一个元素删掉</p><p>sort()可以对当前Array进行排序，它会直接修改当前Array的元素位置，直接调用时，按照默认顺序排序</p><p>reverse()把整个Array的元素给调个个，也就是反转 splice()方法是修改Array的“万能方法”，它可以从指定的索引开始删除若干元素，然后再从该位置添加若干元素</p><p>concat()方法把当前的Array和另一个Array连接起来，并返回一个新的Array；concat()方法可以接收任意个元素和Array，并且自动把Array拆开，然后全部添加到新的Array里</p><p>join()方法是一个非常实用的方法，它把当前Array的每个元素都用指定的字符串连接起来，然后返回连接后的字符串；如果Array的元素不是字符串，将自动转换为字符串后再连接</p><p>如果数组的某个元素又是一个Array，则可以形成多维数组</p><h4 id="_2-2-8-对象" tabindex="-1"><a class="header-anchor" href="#_2-2-8-对象" aria-hidden="true">#</a> 2.2.8. 对象</h4><p>对象是一组由键-值组成的无序集合；键都是字符串类型，值可以是任意数据类型，使用方式： 对象变量.属性名 访问不存在的属性不报错，而是返回undefined 访问属性是通过.操作符完成的，但这要求属性名必须是一个有效的变量名。如果属性名包含特殊字符，就必须用&#39;&#39;括起来：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>var xiaohong = {
    name: &#39;小红&#39;,
    &#39;middle-school&#39;: &#39;No.1 Middle School&#39;
};

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>xiaohong的属性名middle-school不是一个有效的变量，就需要用&#39;&#39;括起来。访问这个属性也无法使用.操作符，必须用[&#39;xxx&#39;]来访问：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>xiaohong[&#39;middle-school&#39;]; // &#39;No.1 Middle School&#39;
xiaohong[&#39;name&#39;]; // &#39;小红&#39;
xiaohong.name; // &#39;小红&#39;

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>也可以用xiaohong[&#39;name&#39;]来访问xiaohong的name属性，不过xiaohong.name的写法更简洁。我们在编写JavaScript代码的时候，属性名尽量使用标准的变量名，这样就可以直接通过object.prop的形式访问一个属性了。 如果我们要检测xiaoming是否拥有某一属性，可以用in操作符：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>var xiaoming = {
    name: &#39;小明&#39;,
    birth: 1990,
    school: &#39;No.1 Middle School&#39;,
    height: 1.70,
    weight: 65,
    score: null
};
&#39;name&#39; in xiaoming; // true
&#39;grade&#39; in xiaoming; // false

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>不过要小心，如果in判断一个属性存在，这个属性不一定是xiaoming的，它可能是xiaoming继承得到的：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>&#39;toString&#39; in xiaoming; // true

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p>因为toString定义在object对象中，而所有对象最终都会在原型链上指向object，所以xiaoming也拥有toString属性。 要判断一个属性是否是xiaoming自身拥有的，而不是继承得到的，可以用hasOwnProperty()方法：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>var xiaoming = {
    name: &#39;小明&#39;
};
xiaoming.hasOwnProperty(&#39;name&#39;); // true
xiaoming.hasOwnProperty(&#39;toString&#39;); // false

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>实际上Number或者其他数据类型作为键也是非常合理的；为了解决这个问题，最新的ES6规范引入了新的数据类型Map Map是一组键值对的结构，具有极快的查找速度； 初始化Map需要一个二维数组，或者直接初始化一个空Map</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>var m = new Map(); // 空Map
m.set(&#39;Adam&#39;, 67); // 添加新的key-value
m.set(&#39;Bob&#39;, 59);
m.has(&#39;Adam&#39;); // 是否存在key &#39;Adam&#39;: true
m.get(&#39;Adam&#39;); // 67
m.delete(&#39;Adam&#39;); // 删除key &#39;Adam&#39;
m.get(&#39;Adam&#39;); // undefined

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>Set和Map类似，也是一组key的集合，但不存储value。由于key不能重复，所以，在Set中，没有重复的key 遍历Array可以采用下标循环，遍历Map和Set就无法使用下标。为了统一集合类型，ES6标准引入了新的iterable类型，Array、Map和Set都属于iterable类型。 具有iterable类型的集合可以通过新的for ... of循环来遍历。</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>var a = [&#39;A&#39;, &#39;B&#39;, &#39;C&#39;];
var s = new Set([&#39;A&#39;, &#39;B&#39;, &#39;C&#39;]);
var m = new Map([[1, &#39;x&#39;], [2, &#39;y&#39;], [3, &#39;z&#39;]]);
for (var x of a) { // 遍历Array
    console.log(x);
}
for (var x of s) { // 遍历Set
    console.log(x);
}
for (var x of m) { // 遍历Map
    console.log(x[0] + &#39;=&#39; + x[1]);
}

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>for ... in循环由于历史遗留问题，它遍历的实际上是对象的属性名称。一个Array数组实际上也是一个对象，它的每个元素的索引被视为一个属性。 当我们手动给Array对象添加了额外的属性后，for ... in循环将带来意想不到的意外效果：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>var a = [&#39;A&#39;, &#39;B&#39;, &#39;C&#39;];
a.name = &#39;Hello&#39;;
for (var x in a) {
    console.log(x); // &#39;0&#39;, &#39;1&#39;, &#39;2&#39;, &#39;name&#39;
}

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>for ... in循环将把name包括在内，但Array的length属性却不包括在内。 for ... of循环则完全修复了这些问题，它只循环集合本身的元素：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>var a = [&#39;A&#39;, &#39;B&#39;, &#39;C&#39;];
a.name = &#39;Hello&#39;;
for (var x of a) {
    console.log(x); // &#39;A&#39;, &#39;B&#39;, &#39;C&#39;
}

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><figure><img src="`+c+'" alt="image.png" tabindex="0" loading="lazy"><figcaption>image.png</figcaption></figure><figure><img src="'+o+`" alt="image.png" tabindex="0" loading="lazy"><figcaption>image.png</figcaption></figure><h4 id="_2-2-9-变量" tabindex="-1"><a class="header-anchor" href="#_2-2-9-变量" aria-hidden="true">#</a> 2.2.9. 变量</h4><p>变量名是大小写英文、数字、$和_的组合，且不能用数字开头，当然也不能是关键字； 可以把任意数据类型赋值给变量，同一个变量可以反复赋值，而且可以是不同类型的变量，但是要注意只能用var申明一次</p><h4 id="_2-2-10-strict-模式" tabindex="-1"><a class="header-anchor" href="#_2-2-10-strict-模式" aria-hidden="true">#</a> 2.2.10. strict 模式</h4><p>如果一个变量没有通过var申明就被使用，那么该变量就自动被申明为全局变量； 启用strict模式的方法是在JavaScript代码的第一行写上：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>&#39;use strict&#39;;

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p>不用var申明的变量会被视为全局变量，为了避免这一缺陷，所有的JavaScript代码都应该使用strict模式。</p><h2 id="_3-函数" tabindex="-1"><a class="header-anchor" href="#_3-函数" aria-hidden="true">#</a> 3. 函数</h2><p>定义</p><p>调用</p><p>参数</p><p>rest 函数</p><p>变量作用域与解构赋值</p><ul><li>局部作用域 <ul><li>块作用域</li></ul></li><li>全局作用域</li><li>命名空间</li><li>常量</li><li>解构</li></ul><p>方法</p><ul><li>对象上绑定的函数就是方法</li><li>this 和 that</li><li>apply</li></ul><h2 id="_4-node" tabindex="-1"><a class="header-anchor" href="#_4-node" aria-hidden="true">#</a> 4. node</h2><h3 id="_4-1-背景" tabindex="-1"><a class="header-anchor" href="#_4-1-背景" aria-hidden="true">#</a> 4.1. 背景</h3><ol><li>微软解散了 IE 浏览器团队，谷歌的团队迅速发展，V8 登场；</li><li>Ryan Dahl 本身是 C/Ｃ++的高性能 Web 工程师，但考察了很多高级语言，发现很多语言虽然同时提供了同步IO和异步IO，但是开发人员一旦用了同步IO，他们就再也懒得写异步IO了，所以，最终，Ryan瞄向了JavaScript；</li><li>选定语言后，还要有运行时引擎，因为V8就是开源的JavaScript引擎，直接拿来主义；</li><li>于是 09 年正式推出基于JavaScript语言和V8引擎的开源Web服务器项目，命名为Node.js；</li><li>虽然JavaScript语言本身是完善的函数式语言，在前端开发时，开发人员往往写得比较随意，让人感觉JavaScript就是个“玩具语言”。但是，在Node环境下，通过模块化的JavaScript代码，加上函数式编程，并且无需考虑浏览器兼容性问题，直接使用最新的ECMAScript 6标准，可以完全满足工程上的需求</li><li>借助JavaScript天生的事件驱动机制加V8高性能引擎，使编写高性能Web服务轻而易举</li><li>io.js将首先添加新的特性，如果大家测试用得爽，就把新特性加入Node.js</li></ol><p>版本号三部分组成：主版本号.次版本号.修订版本号</p><p>修改版本号时，需要遵守约定：</p><p>主版本号：修改的代码对功能产生影响，增加主版本号，并重置次版本号和修订版本号 次版本号：修改代码新增了功能，但没有删除和修改已有的功能，增加次版本号，重置修订版本号 修订版本号：修改代码修复bug，没有新增和删除任何功能，应该增加修订版本号 ————————————————</p>`,84),m={href:"https://blog.csdn.net/HuoYiHengYuan/article/details/100945249",target:"_blank",rel:"noopener noreferrer"},h=e("ul",null,[e("li",null,"波浪号（tilde）+指定版本：比如 ~1.2.2 ，表示安装 1.2.x 的最新版本（不低于1.2.2），但是不安装 1.3.x，也就是说安装时不改变大版本号和次要版本号。"),e("li",null,"插入号（caret）+指定版本：比如 ˆ1.2.2，表示安装 1.x.x 的最新版本（不低于 1.2.2），但是不安装 2.x.x，也就是说安装时不改变大版本号。需要注意的是，如果大版本号为 0，则插入号的行为与波浪号相同，这是因为此时处于开发阶段，即使是次要版本号变动，也可能带来程序的不兼容。"),e("li",null,"latest：安装最新版本。")],-1),g={href:"https://npmjs.xn--org-t33en16dtge1rd2z8bffi3hl9k2b",target:"_blank",rel:"noopener noreferrer"},b=e("p",null,"package.json 与 package-lock.json 介绍",-1),x=r("<li><p>package.json 相当于 Java 中的 pom 文件，用来引入 node 项目中所依赖的 js 包；里面包含了 dependencies 和 devDependencies 等节点；</p></li><li><p>当我们使用 node 进行项目开发时，我们会使用 npm init 命令生成我们项目的骨架。</p></li><li><p>如果我们想要在项目中引入某个 js 包，那么我们可以使用 npm install pakcagename，npm 会自动把依赖信息放入项目根目录下的 package.json 中，同时会把 js 包下载到 node_module 中；</p></li><li><p>由于 js 包的版本命名规范限制和我们使用 js 包时写的版本号，导致今天使用的版本可 abc，到了明天下载下来的版本可能就变了；因此，node 给我们引入 packag-lock.json 文件，用来锁定当前项目所依赖的 js 包的版本，这样就保证了版本的一致性；</p></li><li><p>package-lock.json 文件存在后，npm 执行 install 命令后会首先根据这个文件来下载所需要的依赖包，因此如果修改了 package.json 文件中的版本信息，再次运行项目时就会出现版本冲突的问题，解决思路有两个：</p><ol><li>重新生成 package-lock.json 文件；</li><li>【已验证，推荐使用这种方式】直接修改 package-lock.json 文件中的版本号；</li></ol></li>",5),f={href:"https://blog.csdn.net/drawlessonsfrom/article/details/121616793",target:"_blank",rel:"noopener noreferrer"},_={href:"https://zhuanlan.zhihu.com/p/463697890",target:"_blank",rel:"noopener noreferrer"},S={href:"https://www.cnblogs.com/goloving/p/14602743.html",target:"_blank",rel:"noopener noreferrer"},k={href:"https://www.volcengine.com/theme/4227822-R-7-1",target:"_blank",rel:"noopener noreferrer"};function y(A,j){const a=t("ExternalLinkIcon");return s(),d("div",null,[e("p",null,[e("a",u,[i("https://www.liaoxuefeng.com/wiki/1022910821149312"),n(a)])]),p,e("p",null,[i("原文链接："),e("a",m,[i("https://blog.csdn.net/HuoYiHengYuan/article/details/100945249"),n(a)])]),h,e("p",null,[i('package.json 文件配置说明 name：项目/模块名称，长度必须小于等于214个字符，不能以"."(点)或者"_"(下划线)开头，不能包含大写字母。 version：项目版本。 author：项目开发者，它的值是你在'),e("a",g,[i("https://npmjs.org网站的有效账户名"),n(a)]),i("，遵循“账户名<邮件>”的规则。 description：项目描述，是一个字符串。它可以帮助人们在使用npm search时找到这个包。 keywords：项目关键字，是一个字符串数组。它可以帮助人们在使用npm search时找到这个包。 private：是否私有，设置为 true 时，npm 拒绝发布。 license：软件授权条款，让用户知道他们的使用权利和限制。 bugs：bug 提交地址。 contributors：项目贡献者 。 repository：项目仓库地址。 homepage：项目包的官网 URL。 dependencies：生产环境下，项目运行所需依赖。 devDependencies：开发环境下，项目所需依赖。 scripts：执行 npm 脚本命令简写，比如 “start”: “react-scripts start”, 执行 npm start 就是运行 “react-scripts start”。 bin：内部命令对应的可执行文件的路径。 main：项目默认执行文件，比如 require(‘webpack’)；就会默认加载 lib 目录下的 webpack.js 文件，如果没有设置，则默认加载项目跟目录下的 index.js 文件。 module：是以 ES Module(也就是 ES6)模块化方式进行加载，因为早期没有 ES6 模块化方案时，都是遵循 CommonJS 规范，而 CommonJS 规范的包是以 main 的方式表示入口文件的，为了区分就新增了 module 方式，但是 ES6 模块化方案效率更高，所以会优先查看是否有 module 字段，没有才使用 main 字段。 eslintConfig：EsLint 检查文件配置，自动读取验证。 engines：项目运行的平台。 browserslist：供浏览器使用的版本列表。 style：供浏览器使用时，样式文件所在的位置；样式文件打包工具parcelify，通过它知道样式文件的打包位置。 files：被项目包含的文件名数组。")]),b,e("ol",null,[x,e("li",null,[e("p",null,[e("a",f,[i("package.json和package-lock.json介绍"),n(a)])])]),e("li",null,[e("p",null,[e("a",_,[i("深度解析package-lock.json作用"),n(a)])])]),e("li",null,[e("p",null,[e("a",S,[i("浅析nodejs中的package.json和package-lock.json作用 "),n(a)])])]),e("li",null,[e("p",null,[e("a",k,[i("如何重新生成package-lock.json文件？"),n(a)])])])])])}const w=l(v,[["render",y],["__file","frontend.html.vue"]]);export{w as default};
